/* eslint-disable */

import styles from "./Breed.module.css";

const movies = [
  "https://i.ytimg.com/vi/FJfwehhzIhw/hq720_live.jpg?sqp=CNCviJcG-oaymwEXCNAFEJQDSFryq4qpAwkIARUAAIhCGAE=&rs=AOn4CLAU6jHHvIDGmvOuDU5vcZb5_yrYKg",
  "https://i.ytimg.com/vi/oeffmz_U7sU/hqdefault.jpg?sqp=-oaymwEjCOADEI4CSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=&rs=AOn4CLB1CDzO8O1HG1fCvRpyHT0Yn7FV2g",
  "https://i.ytimg.com/vi/oeffmz_U7sU/hqdefault.jpg?sqp=-oaymwEjCOADEI4CSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=&rs=AOn4CLB1CDzO8O1HG1fCvRpyHT0Yn7FV2g",
  "https://i.ytimg.com/vi/oeffmz_U7sU/hqdefault.jpg?sqp=-oaymwEjCOADEI4CSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=&rs=AOn4CLB1CDzO8O1HG1fCvRpyHT0Yn7FV2g",
  "https://i.ytimg.com/vi/oeffmz_U7sU/hqdefault.jpg?sqp=-oaymwEjCOADEI4CSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=&rs=AOn4CLB1CDzO8O1HG1fCvRpyHT0Yn7FV2g",
  "https://i.ytimg.com/vi/oeffmz_U7sU/hqdefault.jpg?sqp=-oaymwEjCOADEI4CSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=&rs=AOn4CLB1CDzO8O1HG1fCvRpyHT0Yn7FV2g",
  "https://i.ytimg.com/vi/oeffmz_U7sU/hqdefault.jpg?sqp=-oaymwEjCOADEI4CSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=&rs=AOn4CLB1CDzO8O1HG1fCvRpyHT0Yn7FV2g",
];

function Breed(props) {
  return (
    <div class="row">
      <div className={styles.container}>
        {movies.map((src) => (
          <div
            key={src}
            className={styles.card}
            style={{
              backgroundImage: `url(${src})`,
            }}
          />
        ))}
      </div>
    </div>
  );
}

export default Breed;
